const e=JSON.parse('{"key":"v-7549216b","path":"/component-library/element-plus/wrap-dialog/","title":"封装弹框","lang":"zh-CN","frontmatter":{"description":"为什么要封装 弹框看似不大，但是如果跟所属页面写在同一个 SFC 文件中，会使 SFC 文件很臃肿，特别是当一个页面有多个弹框时，所以最好的做法是将弹框封装成组件，这样即不会使 SFC 文件臃肿，也使页面显得更加清晰，便于维护和理解。 封装之后的效果 通过所属页面可以打开弹框，如点击页面中的某个按钮。 通过弹框自身可以关闭弹框，如点击确认、取消、右上角...","head":[["meta",{"property":"og:url","content":"https://vuepress-theme-hope-docs-demo.netlify.app/component-library/element-plus/wrap-dialog/"}],["meta",{"property":"og:site_name","content":"前端笔记"}],["meta",{"property":"og:title","content":"封装弹框"}],["meta",{"property":"og:description","content":"为什么要封装 弹框看似不大，但是如果跟所属页面写在同一个 SFC 文件中，会使 SFC 文件很臃肿，特别是当一个页面有多个弹框时，所以最好的做法是将弹框封装成组件，这样即不会使 SFC 文件臃肿，也使页面显得更加清晰，便于维护和理解。 封装之后的效果 通过所属页面可以打开弹框，如点击页面中的某个按钮。 通过弹框自身可以关闭弹框，如点击确认、取消、右上角..."}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-09-09T14:41:52.000Z"}],["meta",{"property":"article:modified_time","content":"2023-09-09T14:41:52.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"封装弹框\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2023-09-09T14:41:52.000Z\\",\\"author\\":[]}"]]},"headers":[{"level":2,"title":"为什么要封装","slug":"为什么要封装","link":"#为什么要封装","children":[]},{"level":2,"title":"封装之后的效果","slug":"封装之后的效果","link":"#封装之后的效果","children":[]},{"level":2,"title":"实现方式","slug":"实现方式","link":"#实现方式","children":[]}],"git":{"createdTime":1694270512000,"updatedTime":1694270512000,"contributors":[{"name":"stormzhangbx","email":"13128814051@163.com","commits":1}]},"readingTime":{"minutes":0.79,"words":238},"filePathRelative":"component-library/element-plus/wrap-dialog/index.md","localizedDate":"2023年9月9日","autoDesc":true}');export{e as data};
